// StudentLogin.js
import React from 'react';
import { useDispatch } from 'react-redux';
import { useHistory } from 'react-router-dom';

const StudentLogin = () => {
  const dispatch = useDispatch();
  const history = useHistory();

  const handleLogin = () => {
    // Perform login logic, set loggedInUser in Redux store
    dispatch({ type: 'LOGIN', payload: 'student@example.com' });
    history.push('/dashboard/student'); // Redirect to student dashboard
  };

  return (
    <div>
      <h2>Student Login</h2>
      <button onClick={handleLogin}>Login</button>
    </div>
  );
};

export default StudentLogin;
